import React from "react";
import "./"
import { Form, Input, Button } from "antd";
import { authentication } from "../../firebase/firebase";
import { GoogleAuthProvider, signInWithPopup, createUserWithEmailAndPassword } from "firebase/auth";

function Register() {
const provider = new GoogleAuthProvider();
  const onFinish = (values) => {
    console.log("Success:", values);
    createUserWithEmailAndPassword(authentication, values.email, values.password).then((response) => {
        console.log(response)
        alert('Amjilttai bvrtgegdlee')
    }).catch((error) => {
        console.log('error-->', error)
    })
    
  };

  const onFinishFailed = (errorInfo) => {
    console.log("Failed:", errorInfo);
  };

  const signWithGoogle = () => {
      signInWithPopup(authentication, provider)
      .then((response)=>{
          console.log('response---->', response)
          alert('Google-r amjilttai bvrtgelee');
      })
      .catch((error) => {
          console.log('error --<', error)
      })
  }
  return (
    <div className="container">
      <div className="card">
        <Form
          labelCol={{
            span: 8,
          }}
          wrapperCol={{
            span: 16,
          }}
          initialValues={{
            remember: true,
          }}
          onFinish={onFinish}
          onFinishFailed={onFinishFailed}
          autoComplete="off"
        >
        <Form.Item
            className="input-text"
            label="FullName"
            name="fullName"
            rules={[
              {
                required: true,
                message: "*Please input your username!",
              },
              {
                whitespace: true,
              },
              {
                min: 3,
              },
            ]}
          >
            <Input className="input" />
          </Form.Item>
          <Form.Item
            className="input-text"
            label="Email"
            name="email"
            rules={[
              {
                required: true,
                message: "*Please input your username!",
              },
              {
                whitespace: true,
              },
              {
                min: 3,
              },
            ]}
          >
            <Input type={"email"} className="input" />
          </Form.Item>

          <Form.Item
            className="input-text"
            label="password"
            name="password"
            rules={[
              {
                required: true,
                message: "Please input your password!",
              },
            ]}
          >
         <Input type={"password"} className="input" />

         </Form.Item>


         <Form.Item
            className="input-text"
            label="Confirm-password"
            name="confirm-password"
            dependencies={["password"]}
            rules={[
              {
                required: true,
                message: "Please input your password!",
              },
              ({getFieldValue}) => ({
                  validator(_, value){
                    if(!value || getFieldValue('password') === value)
                    {
                        return Promise.resolve();
                    }
                    else {
                        return Promise.reject('does not match');
                    }
                  }
                  
              })
              
            ]}
          >

              
         <Input type={"password"} className="input" />

          </Form.Item>
          <div className="btn-container">
            <Form.Item
              wrapperCol={{
                offset: 8,
                span: 16,
              }}
            >
              <Button className="btn" type="primary" htmlType="submit">
                Register
              </Button>
              <button onClick={signWithGoogle}className="google">
                  Google
              </button>
            </Form.Item>
          </div>
        </Form>
      </div>
    </div>
  );
}

export default Register;
